INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('0af3ffa1-d1ac-4e19-8ac9-b65f77e70a4a', 'Death', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2023-09-29 14:48:57.769546+00', '2024-07-16 09:21:33.44046+00', 15, 'Death was an American death metal band formed in Altamonte Springs, Florida, in 1983 by guitarist Chuck Schuldiner (who later became the band''s sole vocalist), drummer/vocalist Kam Lee and guitarist Rick Rozz. Death is considered to be among the most influential bands in heavy metal music and a pioneering force in death metal. The band''s 1987 debut album, Scream Bloody Gore, has been widely regarded as one of the first death metal records, alongside the first records from Possessed and Necrophagia.');
