INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('07296a52-d7f1-4d2a-b901-fcd71962dda5', 'Los Ángeles Azules', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-05-27 08:41:18.133361+00', '2024-07-15 12:53:45.965851+00', 48, 'Los Ángeles Azules are a Mexican musical group that plays the cumbia sonidera genre, which is a cumbia subgenre using the accordion and synthesizers. This results in a fusion of the sounds of cumbia from the 1950-1970s with those of 1990s-style electronic music.');
INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('b8d0786c-d604-47b8-abd2-88311b965a74', 'Dragonforce', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-03-27 09:50:40.879269+00', '2024-08-27 07:44:30.570382+00', 6, NULL);
INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('600b6211-5b29-4488-9a11-bd05506976bd', 'George Michael', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-05-13 18:50:08.662589+00', '2024-07-15 12:55:14.890467+00', 17, 'George Michael (born Georgios Kyriacos Panayiotou; 25 June 1963 – 25 December 2016) was an English singer-songwriter, record producer and philanthropist. Regarded as a pop culture icon, he is one of the best-selling musicians of all time, with his sales estimated at between 100 million to 125 million records worldwide. Michael was known as a creative force in songwriting, vocal performance, and visual presentation. He achieved 10 number-one songs on the US Billboard Hot 100 and 13 number-one songs on the UK Singles Chart. Michael won numerous music awards, including two Grammy Awards, three Brit Awards, twelve Billboard Music Awards, and four MTV Video Music Awards. He was listed among Billboard''s the "Greatest Hot 100 Artists of All Time" and Rolling Stone''s the "200 Greatest Singers of All Time". The Radio Academy named him the most played artist on British radio during the period 1984–2004. Michael was inducted into the Rock and Roll Hall of Fame in 2023.');
INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('859a900e-e7eb-466d-a2a2-d6cf666d88d6', 'Metallica', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2023-09-29 14:44:57.760027+00', '2024-08-27 07:43:46.818641+00', 3, NULL);
INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('628590e2-663a-4b42-898f-f3bce09472ee', 'Pantera', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2023-09-29 14:44:00.595675+00', '2023-09-29 14:45:21.778807+00', 3, NULL);
