INSERT INTO artists (identifier, display_name, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('4807c743-3821-43de-8dc5-cfaf0d40003a', 'Amon Amarth''', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-06-15 11:31:04.697844+00', '2024-08-15 12:19:46.844002+00', 171, 'Amon Amarth (/əˈmɒn əˈmɑːrθ/) are a Swedish melodic death metal band from Tumba, formed in 1992. The band take its name from the Sindarin name of Mount Doom, a volcano in J. R. R. Tolkien''s Middle-earth. 

Their lyrics mostly deal with Viking mythology and history, and so they have been sometimes erroneously labeled "Viking metal", although the band prefers the term melodic death metal.');
