INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('b5000222-2a13-45cb-a316-c9629f54e84d', 'Raise Your Horns', NULL, 'A E A D F# B', NULL, NULL, NULL, 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-06-15 11:36:50.887508+00', '2024-07-15 12:52:40.693127+00', 176, 'Jomsviking is the tenth studio album by Swedish melodic death metal band Amon Amarth. It was mixed and produced by Andy Sneap and released on 25 March 2016 through Metal Blade Records and Sony Music.  Concept This is the band''s first concept album. Vocalist Johan Hegg described the concept of the album:  The Jomsvikings and their world is the background for the story of a young man that is in love with a girl but unfortunately she''s being married off. He accidentally kills a man when this happens and he has to flee — but he swears to have revenge and win her back. He can''t let go of the past. He feels that he''s been wronged and his life has been destroyed. The way the story evolves is not a happy story.');
