INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('3a8fef67-df6c-4ae0-85a7-dedeec955eb5', 'Left to Die', NULL, '1 step down - D', NULL, 'Leprosy', 'https://en.wikipedia.org/wiki/Leprosy_(album)', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-07-16 09:20:45.463388+00', '2024-08-26 18:19:23.088486+00', 130, 'Leprosy is the second studio album by American death metal band Death, released on November 16, 1988, by Combat Records. The album is notable in its different tone and quality from the band''s 1987 debut, it is the first example of Scott Burns'' work heard on many of the death metal and grindcore albums of that era. The cover is featured in Metal: A Headbanger''s Journey. It is the first album to feature drummer Bill Andrews and the only one to feature guitarist Rick Rozz.');
INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('1540623d-6f08-4fe6-8280-7d05a4042da1', 'Pull the Plug', NULL, '1 step down', '1988', 'Leprosy', NULL, 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-06-04 08:08:26.094251+00', '2024-06-04 08:16:14.150033+00', 180, NULL);
