INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('b21942c3-fb7c-4d85-82e5-1d41ed89e075', 'Crystal Mountain', NULL, 'D G C F A D', NULL, NULL, NULL, 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2023-10-16 12:37:26.208003+00', '2023-11-23 16:24:53.133989+00', 30, NULL);
INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('73e032df-e926-4d14-837c-e6811138ce68', 'A Fine Day To Die', NULL, NULL, NULL, NULL, NULL, 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-08-14 16:19:37.664874+00', '2024-08-23 21:25:57.510904+00', 50, 'Blood Fire Death is the fourth studio album by Swedish extreme metal band Bathory. It was released on 8 October 1988, through Music for Nations sublabel, Under One Flag. The album, although mostly black metal, includes some of the first examples of Viking metal.

According to the book Black Metal: Evolution of the Cult by Dayal Patterson, Blood Fire Death began a second trilogy, an era Quorthon described as the "pre-Christian Swedish Viking Era".');
INSERT INTO songs (identifier, display_name, music_key, music_tuning, music_creation_date, album_name, album_info_link, created_by, visibility_status, approved_by, created_at, last_edited_at, views, description) VALUES ('ac7a1aba-9654-4971-a973-a30374432fd2', 'Mr Crowley', NULL, 'Standard - E A D G B E', 'September 1980', 'Blizzard of Ozz', NULL, 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, NULL, '2024-08-26 18:39:48.599181+00', '2024-08-26 18:42:14.161477+00', 11, '"Mr. Crowley" is a song by English heavy metal singer Ozzy Osbourne, about English occultist Aleister Crowley. Written by Osbourne, guitarist Randy Rhoads and bass guitarist/lyricist Bob Daisley, it was released on Osbourne''s debut solo album Blizzard of Ozz in September 1980 in the United Kingdom.

A live version was released as a UK single in November 1980. In North America, the studio version was released as a single in 1981.');


