INSERT INTO song_comments (identifier, parent_identifier, song_identifier, created_by, visibility_status, contents, approved_by, created_at, last_edited_at) VALUES ('06049961-c116-4dc0-928f-083f267ed33b', NULL, 'c70dbe2e-3e46-43e5-a1c9-fa24ce330b8a', 'cab727b8-37fb-46c0-947a-44a2b576bf9c', 0, '
the pre chorus goes like this for all of you who want to know theres different ways to play the song but im gonna tab the way that he did it.
------------------------------------------------|
------------------------------------------------|
-----------2------------------7-7--7-7----------|
--4-----2--2------2-2------2--7-7--7-7----------|
--4-2h4----0--2h4---2--2h4----5-5--4-4----------|
--2-----------------0---------------------------|
and for the harmonic screams to get that sound you have to flick the string, dump the bar and hammer on a harmonic. then pull the bar about 4 or 5 steps and you should get that sound, but you kinda have to do it all in one motion.  flicking the string and dumping the bar kinda make the string a little flappy and just kinda tap a harmonic then pull it up, takes practice but in a couple weeks you guys will have it down also you can learn how to do it from the link below', NULL, '2024-02-08 08:19:17.078181+00', NULL);


