P  - Pick off
/  - Slide up to...
\  - Slide down to...
T  - Tap (With pick or finger)
h  - Harmonic (Natural)
A  - Harmonic (Artificial)
~  - Vibrato
X_ - Pick slide
PM - Palm mute
Tr - Trill
Wh - Use whammy bar
^  - Bend string up ( x steps )
`  - Release bend ( x steps )
 
|
@  - Rhythm slash ( Power chord noted)
 
|  - Time slash ( 4\4 Time, etc... )
=  - Let ring


 
NOTES :
-------
 
        -   For the intro solo, use the left hand for all taps - The open
string is picked with the pick, then hammer on with your index finger,
then little finger for the highest note. This technique is also used in
the main solo as well.
 
        -   For the tapping part on the main solo, i find it easier to
use my middle finger rather than the pick edge (Since it is not too
fast)
 
There are probably a lot of mistakes in this transcription, any
corrections and/or additions would be gratefully received. Also the rest
of the lyrics would be a Bonus! Listen to the song to get the feel of
the rhythm (and lead parts!!) - It''s difficult to convey the timing
accurately using this format.', 'Metallica - Am I Evil?
